import "./tasks.css";

const Tasks = (props) => (
    <ul className="tasks">
        {props.tasks.map(task => (
            <li className={`list__item ${props.hideDoneTasks && task.done ? "tasksList__item--hidden" : ""}`}>
                {}
            </li>
        ))}
    </ul>);

export default Tasks;
